// Dependencies.
import React from 'react';

// Component 'TopScroll'.
function TopScroll() {
    return (
        // TopScroll Container.
        <>
            <button className="float-right btn btn-info">Top Scroll</button>
        </>
    );
}

// Do export.
export default TopScroll;
